Yurizan and Krissy are secret lesbian lovers who are rushed to the hospital after being in a car accident, nothing serious, but they need attention for whiplash. While waiting to see a doctor, Yurizan reveals some crucial information to Krissy just as doctor Jordan arrives. He soon discovers the truth and wants to get even.
